import React, { Component } from 'react';
import Game from './components/Game/game';

export default class App extends Component {

    async componentDidMount() {
        const response = await
            fetch('https://starnavi-frontend-test-task.herokuapp.com/game-settings'
            )

        const GameSettings = await response.json()
        let sizeEasyMode = gameSettings.easyMode.field;

        let sizeNormalMode = gameSettings.normalMode.field;
        let sizeHardMode = gameSettings.hardMode.field;

        let delayTimeEasyMode = gameSettings.easyMode.delay;
        let delayTimeNormalMode = gameSettings.normalMode.delay;
        let delayTimeHardMode = gameSettings.hardMode.delay;

        console.log (sizeEasyMode);
        console.log (sizeNormalMode);
        console.log (sizeHardMode);

        console.log (delayTimeEasyMode);
        console.log (delayTimeNormalMode);
        console.log (delayTimeHardMode);


        const response1 = await
            fetch('https://starnavi-frontend-test-task.herokuapp.com/winners'
            )

    }

    render() {
        return (

            <div className="d-flex">
                <div>
                    <label>choose level: </label>
                    <select>
                        <option value="low">Low</option>
                        <option value="average">Average</option>
                        <option value="High">High</option>
                    </select>
                </div>

                <div>
                    <input placeholder='User Name' type='text'></input>
                </div>

                <div>
                    <button>Play</button>
                </div>

                <div>
                < Game />
            </div>
            </div>

        );
    }
}
